{{Infobox dungeon |name = Cave of Being |image = [[File:Cave of Being.png|300px]] |caption = A map of Cave of Being. |tokens = 286,500 |location = Between Unova Route 19 & 20 }} '''Cave of Being''' is a [[Dungeons|dungeon]] in [[Unova]]. It initially has 81 tiles arranged in an 9x9 square, including 9 chest tiles, 21 non-boss encounter tiles, and 1 boss encounter tile.
